import Firebase from "../../firebase_settings/index.js"
//, setDoc, serverTimestamp 

export default {
    receive_data(uid) {
        const db = Firebase.db;
        db.collection('userData').get(uid).then((querySnapshot) => {
            console.log(querySnapshot)
        }).catch((error) => {
            console.log(error);
            // テーブルリセット
            this.items = [];
        });
    },
}
